\nINTRUÇÕES DE USO:
\n-PASSO 1: Primeiro, solte as tiras e remova a placa frontal.
\n-PASSO 2: Abra o forro e vista a bota. Certifique-se de que a panturrilha e o pé estão confortavelmente encaixados e feche o forro.
\n-PASSO 3: Coloque a placa frontal sobre o forro e certifique-se de que o “Pump” está alinhado com a abertura.
\n-PASSO 4: Aperte as faixas do tornozelo, pé e panturrilha em sequência e certifique-se de que as mesmas estejam firmes e confortáveis.
\nEm seguida, pressione o “Pump” para inflar o sistema de ar até que ele forneça suporte e a compressão confortável adequada. Caso fique desconfortável, vire o botão laranja para a posição ''R'' (direita), ''L' (esquerda)' ou ''+'' (direta e esquerda) e, em seguida, pressione-o para esvaziar ou ajustar a pressão do forro à direita, esquerda ou ambos os lados.
\n-PASSO 5: Para retirar a bota, pressione o botão laranja até o sistema de ar esvaziar, afrouxe as alças, retire a placa frontal e, em seguida, retire o pé e a panturrilha para frente e para fora.
\n
\nCOMPOSIÇÃO:
\n-Estrutura: 100% polipropileno;
\n-Forro: espuma de poliuretano 50% + nylon 50%; -Sola: 100% tpe (elastômero termoplástico);
\n-Cinta de panturrilha: 100% polipropileno; -Passador: 100% nylon;
\n-Pump central/anterior: tpe 70% + abs (plástico) 20%+ poliacetal 5% + aço 5%;
\n-Palmilha: 100% e.v.a.;
\n-Fechos: 50% nylon + 50% poliester.

