\n<h2>Instruções de Uso</h2>
\nO produto deve ser instalado sobre o colchão comum, fixando através de suas abas. Certifique-se de que não esteja em contato com partes cortantes ou bordas que possam danificá-lo.
\n1 - Coloque o Colchão Pneumático sobre o colchão comum;
\n2 - Envolva o colchão comum com as abas do Colchão Pneumático;
\n3 - Conecte as mangueiras de ar na Bomba Compressora Bivolt Hidrolight e no Colchão Pneumático;
\n4 - Puxe os ganchos que estão atrás da Bomba Compressora Bivolt Hidrolight para suspendê-la na cama (na extremidade dos pés) ou posicione-a em um local estável e protegido de impactos;
\n5 - Certifique-se de que os tubos de ar não estejam presos ou dobrados;
\n6 - Conecte o cabo de alimentação à tomada;
\n7 - Cubra o Colchão Pneumático com um lençol (NÃO UTILIZAR EM CONTATO DIRETO COM O PACIENTE).
\n8 - Ligue a Bomba Compressora Bivolt Hidrolight acionando o botão em seu painel;
\n9 - Ajuste a pressão no nível máximo e aguarde por volta de 10 minutos até o colchão inflar completamente;
\n10 - Por fim, ajuste o nível de pressão de acordo com orientação médica ou conforme peso do usuário através da tabela abaixo:
