Descrição:
A Cadeira de Rodas Indy Infantil foi projetada para atender crianças que possuem qualquer tipo de dificuldade locomotiva. O equipamento foi desenvolvido para possibilitar uma mobilidade ágil e fácil. Por isso, conta com rodas traseiras de 20’’ raiadas com pneus infláveis e rodas dianteiras de 6’’ maciças com garfos injetados em nylon, que possibilitam a locomoção até em terrenos mais difíceis.
\n
\nSua estrutura em monobloco confeccionada com alumínio aeronáutico trazem uma maior estabilidade para o equipamento, além de ser leve e resistente. Ainda, trata-se de um material com ótima durabilidade e de fácil de manutenção.
\n
\nSegurança é prioridade para a Cadeira de Rodas Indy Infantil. O equipamento com freios bilaterais reguláveis e uma tecnologia anti-tombo, componentes essenciais para assegurar a proteção da pessoa. Além disso, conta com protetores de roupa para garantir uma melhor comodidade ao usuário.
\n
\nPraticidade e conforto também são pontos fundamentais da Cadeira de Rodas Indy Infantil. Sua leveza ao lado do sistema de desmontagem rápida deixa o equipamento mais fácil de manusear. Também, conta com estofamento em nylon acolchoado e almofada, que garantem a comodidade devida.
\n
\nA Cadeira de Rodas Indy Infantil foi desenvolvida para atender as vontades do usuário. Dessa forma, conta com inclinação por sistema de pistão acionado por pedal e apoio de cabeça com regulagem de altura e profundidade. Ainda, possui capacidade para até 50 kg e tem largura de assento de até 36 cm.
\n
\nCaracterísticas:
\n- Confeccionada em alumínio aeronáutico;
\n- Estrutura monobloco dobrável em L;
\n- Pintura eletrostática epóxi;
\n- Apoio de cabeça com regulagem de altura e profundidade;
\n- Estofamento em nylon acolchoado;
\n- Almofada;
\n- Rodas traseiras de 20’’ raiadas com pneus infláveis;
\n- Rodas dianteiras de 6’’ maciças com garfos injetados em nylon;
\n- Sistema de desmontagem rápida nas rodas traseiras “quick release”;
\n- Freios bilaterais reguláveis;
\n- Protetores de roupa;
\n- Apoio de pé plataforma regulável em altura;
\n- Inclinação por sistema de pistão acionado por pedal;
\n- Inclinação de 4 – 28 graus;
\n- Anti-tombo com ponteira;
\n- Capacidade para 50 kg;
\n- Largura do assento: 30 – 36 cm.

