DESCRIÇÃO:
\nIndicado para massagem pós procedimento cirúrgico, alívio de tensão muscular, reduzindo sinais de inflamação, relaxamento da pele após fazer a barba e depilação entre outros.
\n
\nHIGIENE E CONSERVAÇÃO:
\n-Armazenar e transportar o produto em sua embalagem original, em local seco, arejado e protegido da luz do sol;
\n-Periodicamente lubrificar as partes móveis;
\n-Consultar o manual de instruções inclusas junto ao produto para mais informações.
\n
\nBENEFICIOS:
\n-Use em pós cirúrgicos para reduzir edema e realizar drenagem;
\n-Após qualquer procedimento estético com creme calmante e hidratante;
\n-Para olhos inchados ou rosto na parte da manhã;
\n-Para fechar os poros antes da maquiagem;
\n-Minimiza a formação de rugas finas;
\n-Ice Roller pode ser usado para reduzir dores de cabeça;
\n-Reduz alergia e edema para picadas de insetos;
\n-Use Ice Roller sobre dor muscular e tensão;
\n-Após o barbear, o uso de Ice Roller ajudará a acalmar a pele;
\n-Use o rolo de gelo em caso de febre;
\n-Use o rolo de gelo nos olhos para liberar tensão ou fadiga.
